const Main: React.FC = () => {
  return (
      <Container>
          <Header>
              <ProfileInfo>
                    <strong>Tweets</strong>
              </ProfileInfo>
          </Header>

          <ProfilePage />


            <div>
                <SearchWrapper>
                    <SearchInput placeholder="Tweet to @twitterapi" />

                </SearchWrapper>
            </div>
      </Container>
  );
}

export default Main;
